import styled from "styled-components";
import { Flex } from "../../defaultStyles";

const NavLink = styled.div`
    font-family: 'Inter';
    font-style: normal;
    font-weight: 700;
    font-size: 14px;
    line-height: 24px;
    color: #F0F1F5;
`;
export const NavItem: React.FC<{ title: string, }> = ({ title }) => {
    return (
        <Flex>
            <img src={`../../${title}.svg`} />
            <NavLink>{title}</NavLink>
        </Flex>

    )
}
